    useParams,
  } from "react-router-dom";

function CardDetailPage(props){

    let authorImgUrl = "https://media-exp1.licdn.com/dms/image/C4E03AQFYIhvlCLQ7fw/profile-displayphoto-shrink_800_800/0/1634408897588?e=1655337600&v=beta&t=9eu3H4crWM93UrbCh2daNc4tQywK2ZnUk4cfewU_Q8s"

    const { movieContent } = useParams();

    return(
        <div className='page-container'>
            <Navbar home/>
            <div className=''>
            <div className='author-info'>
                <img className='author-img'  src={authorImgUrl} alt="cardImage"/>
                <div className='author-text'>
                    <div className='author-name'>Ömer Faruk KÖSE</div>
                    <div className='author-date'>Haziran 17</div>
                </div>
            </div>
                <div className='movie-header'>
                    <div className='movie-img'>my title is {movieContent}</div>
                    <div className='movie-title'></div>
                </div>
                <div className='movie-content'></div>

            </div>
        </div>
    )
}

export default CardDetailPage;
